import React from 'react';
import Node from '../components/Node';
import Header from '../components/Header';
import Footer from '../components/Footer';


function NodePage() {
  return (
    <div>
      <Header/>
     <Node/>
     <Footer/>
    </div>
  );
}

export default NodePage;
